A suggestion to fix the hard-coded 500  to an exception to handle the status code

[https://github.com/slimphp/Slim/blob/5.x/Slim/Middleware/ExceptionMiddlewareTrait.php#L92](url)

```php
 private function createResponse(Throwable $exception, string $payload, string $contentType): ResponseInterface
    {
        $response = $this->responseFactory
            ->createResponse(500)
            ->withHeader('Content-Type', $contentType);

        $response->getBody()->write($payload);

        if ($exception instanceof HttpMethodNotAllowedException) {
            $allowedMethods = implode(', ', $exception->getAllowedMethods());
            $response = $response->withHeader('Allow', $allowedMethods);
        }

        return $response;
    }
```

